SnippetCode.val:
using System;
using Newtonsoft.Json;
using Newtonsoft.Json.Linq;

public static class Snippet
{
	public static System.String func(System.String myJson, ref System.String mySigCounter, ref System.String mySig, ref System.String myLogTime)
	{
		string result = "";
		var obj = JObject.Parse(myJson);
		result = obj.GetValue("transactionNumber").ToString();
		mySigCounter = obj.GetValue("signatureCounter").ToString();
		mySig = obj.GetValue("signatureValue").ToString();
		myLogTime = obj.GetValue("logTime").ToString();
		return result;				
	}

}
